  KEY `imagem` (`imagem`),
  CONSTRAINT `produto_ibfk_1` FOREIGN KEY (`imagem`) REFERENCES `imagens` (`imagem`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

